import React from 'react';
import TopBar from './Components/TopBar'; // Contains title and filters
import MetricCard from './MetricCard'; // Metric cards for key stats
import './DashboardOverview.css';

const DashboardOverview = () => {
  return (
    <div className="dashboard-overview">
      <TopBar />
      <div className="card-grid">
        <MetricCard title="Average Latency" value="50ms" description="Average Latency Across Africa" />
        <MetricCard title="Download Speed" value="100Mbps" description="Africa average" />
        <MetricCard title="Upload Speed" value="20Mbps" description="Country comparison" />
        <MetricCard title="Packet Loss" value="0.2%" />
        <MetricCard title="Top 3 ISPs" description="Africa-wide" />
        <MetricCard title="Highest Latency ISP" description="Africa-wide" />
      </div>
    </div>
  );
};

export default DashboardOverview;
